  \"2015-09-26T22:03:12.615044\",\n\t\"name\": \"noaa-raster-navigational-charts-rnc\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA, National Ocean Service, Office of
  Coast Survey, Marine Chart Division is responsible to build and maintain a suite
  of more than 1000 nautical charts that are used by commercial and recreational mariners
  to navigate the United States and U. S. territory waters safely.A Nautical Chart
  is a graphic portrayal of the marine environment. They are used to lay out courses
  and navigate ships by the shortest and most economically safe route. They can also
  serve as base maps for resource management and shoreline development planning by
  state and local government.Charts depict the location of the shoreline, minimum
  water depths, aids to navigation, hazards to navigation, the nature and form of
  the coast, water depths, the general character and configuration of the sea bottom,
  the rise and fall of the tides, protected areas, and the characteristics of the
  Earth's magnetism.The suite of charts is compiled and maintained with data provided
  by federal, state, and private partners such as the National Ocean Service elements,
  United States Coast Guard, United States Army Corps of Engineers, United States
  Power Squadron Auxiliary, Port Authorities.The charts are currently available as
  Lithographically printed paper charts, Electronic Raster Nautical Charts (RNCs),
  up-to-date paper charts (printed with print on demand technology), and are now offered
  as Digital Vector Electronic Nautical Charts (ENC).The NOAA RNCs are electronic
  images of the NOAA paper charts. The NOAA RNCs were productized with a successful
  Cooperative Research and Development Agreement (CRADA) with private sector partner
  BSB Electronic Charts, a subsidiary of Maptech, Inc. Andover, Massachusetts. As
  of November 1, 2005 the NOAA RNC's are available for free download via the NOAA
  website.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
